import React from 'reactn';
import styled from 'styled-components';

class Intro extends React.Component {
  constructor(props) {
      super(props);
  }

  render() {
    const Wrapper = styled.div`
        height: 487px;
        background-color: red;
    `;
    return (
        <Wrapper></Wrapper>
    )
  }
};
export default Intro;
